import Game from "./Game"

export default function GamesList({games,selectedGame,setSelectedGame})
{

    const gamesList=games.map((game)=>(
        <Game key={game.id} game={game} selectedGame={selectedGame} setSelectedGame={setSelectedGame}/>
    ))
   return  (<ul  className="mt-4 space-y-2">{gamesList}</ul>)
}
